import SuperagentBackend from "./superagent/SuperagentBackend";

const auth = {
	login: (loginData) => SuperagentBackend.post('/auth/login', loginData).timeout({response: 50000}),
	register: (data) => SuperagentBackend.post('/auth/register', data),
};

export default {
	auth,
};
